import styles from "./Search.module.scss";
const Search = ({ serachValue, setSerachValue }) => {
  return (
    <div className={styles.root}>
      <svg
        className={styles.icon}
        height="22"
        viewBox="0 0 512 512"
        width="22"
        xmlns="http://www.w3.org/2000/svg"
