        value={serachValue}
        onChange={(event) => setSerachValue(event.target.value)}
        className={styles.input}
        placeholder="Поиск пиццы..."
      />
      <svg viewBox="0 0 32 32" xmlns="http://www.w3.org/2000/svg"><title/><g id="cross"><line class="cls-1" x1="7" x2="25" y1="7" y2="25"/><line x1="7" x2="25" y1="25" y2="7"/></g></svg>
    </div>
  );
};

export default Search;
